import React, { useState, useEffect } from 'react';

function Game(){
    const [boxLimit, setBoxLimit] = useState([]);

    useEffect(()=> {
        const arr =[];
        for(let i=0; i< 60; i++){
            arr[i]=i;
        }
        setBoxLimit(arr);
    },[])

    return (
        <div>
            <div className="ui_grid">
                {boxLimit.map(box => <div className="box" id={box} key ={box}>
                            <div>{box}</div> 
                            <div className={`cell${box}`}> </div>
                        </div>)}
            </div>
        </div>
        
    );
}


export default Game;
